import { Routes, Route } from 'react-router-dom'
import Home from './routes/Home'
import AboutPage from './pages/About/AboutPage';
function App() {
  return (
    <Routes>
      <Route path='/' element={<Home />}/>
      <Route path='about' element={<AboutPage />} />
    </Routes>
  );
}

export default App;
